import React from "react";
import "./Sidebar.css";
import EventIcon from '@material-ui/icons/Event';
import WhatshotIcon from '@material-ui/icons/Whatshot';
import TrendingUpIcon from '@material-ui/icons/TrendingUp';
import HomeIcon from '@mui/icons-material/Home';
import PersonIcon from '@mui/icons-material/Person';
import WbSunnyIcon from '@mui/icons-material/WbSunny';

const Sidebar = () => {
    return(
        <div className="Sidebar">
            <div className="Sidebar-Inner">
                <div className="Sidebar-Menu">
                   <ul className="Sidebar-List">
                       <a href="home" className="Sidebar-List-Item"> <HomeIcon className="icon"/>Home</a>
                       <a href="profile" className="Sidebar-List-Item"><PersonIcon className="icon"/> Profile</a>
                       <a href="weather" className="Sidebar-List-Item"><WbSunnyIcon className="icon"/>Weather</a>
                       <a href="crypto" className="Sidebar-List-Item"><HomeIcon className="icon"/>Crypto Value</a>
                        <a href="news" className="Sidebar-List-Item"><HomeIcon className="icon"/>Top Headlines</a>

                   </ul>
                </div>
            </div>
        </div>
    );
}

export default Sidebar;
